You can use localeCompare() to compare strings in a case-sensitive way:
var names = ["John", "john", "jOHN", "JOHN"];
names.sort(function(a, b) {
  return a.localeCompare(b);
// ["John", "john", "jOHN", "JOHN"]
You can also use the Intl.Collator object to sort strings in a case-sensitive way:
var names = ["John", "john", "jOHN", "JOHN"];
var collator = new Intl.Collator(undefined, { sensitivity: 'case' });
names.sort(collator.compare);
